import React from 'react';
import './Overview.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import {
  Container,
  Row,
  Col,
  Table,
  Spinner,
  Dropdown,
  DropdownButton,
  Button,
} from 'react-bootstrap';

const RenderDropdown = (props) => {
  return (
    <DropdownButton
      variant="secondary"
      className="dropdown"
      id="dropdown-basic-button"
      title={props.selectedAsset}
    >
      {props.assetList.map((asset, index) => {
        return (
          <Dropdown.Item key={index} onClick={() => props.setAsset(asset.name)}>
            {asset.name}
          </Dropdown.Item>
        );
      })}
    </DropdownButton>
  );
};
